import React from "react";
import { Link } from "react-router-dom";

const navBar = () => {
  return (
    <div>
      <nav>
        <ul>
          <li>
            <h1>hello 1</h1>
            <a href='/first'></a>
            <Link></Link>
            {/* <Link to="/first">First Interface</Link> */}
          </li>
          <li> 
            <h1>hello 2</h1>
            {/* <Link to="/second">Second Interface</Link> */}
          </li>
          <li>
            <h1>hello 3</h1>
            {/* <Link to="/third">Third Interface</Link> */}
          </li>
          <li>
            <h1>hello 4</h1>
            {/* <Link to="/forth">Forth Interface</Link> */}
          </li>
        </ul>
      </nav>
    </div>
  );
};

export default navBar;
